export default {
  name: 'UpdateUgroup',
  props: {
    form: {
      type: Object,
      default: function() {
        return {
          username: '',
          email: ''
        }
      }
    },
    glist: {
      type: Array,
      default: () => []
    },
    goption: {
      type: Array,
      default: () => []
    }
  },
  data() {
    return {
      currentGlist: this.glist
    }
  },
  watch: {
    glist() {
      this.currentGlist = this.glist
    }
  },
  methods: {
    submitForm() {
      this.$refs.form.validate((valid) => {
        if (valid) {
          this.$emit('submit', this.form.id, this.currentGlist)
        } else {
          return
        }
      })
    },
    cancelForm() {
      this.$emit('cancel')
    }
  }
}
